        <div className="form-bottom-row">
          <label htmlFor="">Exp. Date</label>
          <label htmlFor="">(MM/YY)</label>
          <label htmlFor="">CVC</label>
        </div>
        <button className="form-button" type="submit">
          Confirm
        </button>
      </form>
    </main>
  );
};

